def codificar():
	filas = [1, 2, 3, 4, 5, 6, 7, 8]
	columnas = [1, 2, 3, 4, 5, 6, 7, 8]
	letras = [chr(256+i) for i in range (len(filas)*len(columnas))]
	return letras


def decodificar(n):
	x = ord(n)
	m = x % 8
	columna = m + 1
	fila = ((x-256)//8)+1
	if fila == 1:
		fila = "a"
	elif fila == 2:
		fila = "b"
	elif fila == 3:
		fila = "c"
	elif fila == 4:
		fila = "d"
	elif fila == 5:
		fila = "e"
	elif fila == 6:
		fila = "f"
	elif fila == 7:
		fila = "g"
	elif fila == 8:
		fila = "h"
	return fila, columna

letras = codificar()


class Tree():
    def __init__(self,label,iz,der):
        self.label = label
        self.left = iz
        self.right = der


def string2Tree(A):
    conectivos = ["y","o",">"]
    stack = []
    for c in A:
        if c in letras:
            stack.append(Tree(c,None,None))
        elif c == "-":
            formaux = Tree(c, None, stack[-1])
            del stack[-1]
            stack.append(formaux)
        elif c in conectivos:
            formaux = Tree(c, stack[-1], stack[-2])
            del stack[-1]
            del stack[-1]
            stack.append(formaux)
    return stack[-1]


def Inorder(arbol):
	conectivosBinarios = ["y","o",">"]
	if arbol.label in letras:
		return arbol.label
	elif arbol.label == "-":
		return arbol.label+Inorder(arbol.right)
	elif arbol.label in conectivosBinarios:
		return "("+Inorder(arbol.left)+arbol.label+Inorder(arbol.right)+")"
	else:
		print("Oops, rotulo incorrecto")


